(757, '11957', 'mbaker073@gmail.com', 'Home-Owner', 'Michelle', '0421557039', '', '', '95 Upper Lancaster Rd Acsot', 'Residential (renovation)', '', '', 'Same as Address', 'Less than 1 month', 'Builder', 'Micheal Dent - Interior/Exterior Builders', 'Tracy', 'Hi - Micheal is currently renovating our home and he has recommended that you guys should be on our list of tile suppliers to see.  We will need to tile 2 outdoor areas (incl a pool), 3 bathrooms, laundry and the living area downstairs - approx 200m2 in total.  We like travertine but it is too expensive (installation costs almost double the cost) so we are looking for an alternative.  Look forward to meeting with you.  Michelle', 'March', '13', '2012', 'Tuesday, March 13, 2012', '4 pm', '00', '12/03/12 (09:48am)'),
