(761, '11961', 'lot212dickson@gmail.com', 'Home-Owner', 'Bridget Asher', '0452255430', '07 3292 7318', '', '36 Langham Crescent\r\nNorth Lakes\r\n4509', 'Residential (new construction)', '', '', 'Lot 212 Dickson Crescent\r\nNorth Lakes\r\n4509', '1-3 months', 'Builder', 'McCarthy Homes', 'Tracy', 'Hi Tracy\r\n\r\nWas great to meet you and your help was greatly appreciated.  Are you available 10am Saturday when we can bring in the plans and contract to sort things further?  \r\n\r\nWe also have a question on what manufacturer you use for the porcelain tiles as we see on the sample tiles they have only a top scim of colour and doesn''t appear to be all the way through the tile.\r\n\r\nIf 10am does not suit then we are happy to fit around when does.\r\n\r\nKind regards\r\nBridget & Neil', 'August', '18', '2012', 'Saturday, August 18, 2012', '10 am', '00', '13/08/12 (11:00am)'),
