(1, 0, 1, 0, 0, 0, 0, 0, '', 'Home', 'Home', 'Home', 'index.php', 0, '', '<h1>Tiles Brisbane</h1>\r\n<h2>Welcome to <em>The Tile Mob Brisbane</em></h2>\r\n<p>For quality <a href="http://www.tilemob.com.au/tm_catalogue/index.php?open=gallery/tiles/floors/commercial/page1/index.php?page=1" title="tiles in Brisbane"><strong>tiles in Brisbane</strong></a>, Queensland and Australia wide look no further than <a href="http://www.tilemob.com.au/about-us/" title="The Tile Mob"><strong>The Tile Mob</strong></a>. Servicing our clients with a huge range of quality tiles in the <a href="http://www.tilemob.com.au/contact-map/" title="Brisbane"><strong>Brisbane</strong></a> area since 1976 we source the best <a href="/tm_catalogue/index.php?open=gallery/stone/page1/index.php?page=1"><b>stone</b></a>, <a href="/tm_catalogue/index.php?open=gallery/mosaics/page1/index.php?page=1"><b>mosaics</b></a>, <a href="/tm_catalogue/index.php?open=gallery/slate/page1/index.php?page=1"><b>slate</b></a>, <a href="/tm_catalogue/index.php?open=gallery/terracotta/page1/index.php?page=1"><b>terracotta</b></a> and <a href="/tm_catalogue/index.php?open=gallery/terracotta/page1/index.php?page=1"><b>ceramic tiles</b></a>tiles from manufacturers around the world to offer you not only Brisbane, but Australia&#39;s widest selection of premium <a href="http://www.tilemob.com.au/tm_catalogue/index.php?open=gallery/tiles/floors/commercial/page1/index.php?page=1" title="floor"><strong>floor </strong></a>and <a href="http://www.tilemob.com.au/tm_catalogue/index.php?open=gallery/tiles/wall/bathrooms/page1/index.php?page=1" title="wall tiles"><strong>wall tiles</strong></a>.</p>\r\n<p>\r\n	We back our Tiles with our proven <a href="http://www.tilemob.com.au/e3-performance-system/" title="E3 performance system"><strong>E3 performance system</strong></a>, not offered by any other Tile supplier in Australia. Our enthusiastic and experienced team of tile stylists will work with you to create compelling living or commercial spaces for your next building or renovation project.</p>\r\n<p>\r\n	If you&rsquo;re after an easy process and a guaranteed quality outcome for your next tile project, visit the team at The <a href="http://www.tilemob.com.au/booking/" title="Tile Mob Brisbane showroom"><strong>Tile Mob Brisbane showroom</strong></a> today.</p>\r\n', ''),
(2, 0, 2, 0, 0, 0, 0, 0, '', 'About Us', 'About Us', 'About Us', 'about-us', 0, '', '<h1>About Us</h1>\r\n<p>\r\nThe Tile Mob was founded in 1976 as a tile retailer that would be different from others in two main ways:</p>\r\n<p>\r\n1). We would supply tiles from the best manufacturers in Australia and around the world and<br/>\r\n2). We would back it up with sales and technical advice that was second to none.</li>\r\n</p>\r\n<p>\r\n<img src="/images/Tile-Mob-Team.jpg" alt="The Tile Mob" align="right" width="174" height="223" />Through these goals, we have become recognised as one of Brisbane’s finest tile suppliers. As a family-owned independent trader, we are not linked to any single manufacturer or wholesaler so can offer the best advice on your tiling project.\r\n</p>\r\n<p>\r\nDiscerning homeowners, interior decorators and architects turn to our vast selection of wall and floor tiles sourced from high-tech international and Australian factories through to single-artist studios to create residential and commercial spaces of distinction.  What’s more, you may browse through a range of elegant marble panels, hand-painted murals and decorative border tiles in a plethora of styles - from contemporary stainless steel and metal to sophisticated glass & marble listellos.\r\n</p>\r\n<p>\r\nRegardless of your project’s size or complexity, turn to The Tile Mob to get the right tile for the right job, every time.  We’re big enough to provide global best practice yet small enough to take a personal stake in your project.\r\n</p>', '<h1>Tile Stylists</h1>\r\n<img src="/images/Designer-wall-tiles.jpg" alt="Designer Wall Tiles" align="right" width="168" height="162">\r\n<p>Looking for the latest in design trends?  Not sure what you want?  We have the product and design expertise to help you arrive at a decision that''s right for you. \r\n</p>\r\n<p>\r\nOur experienced team of tile stylists draw on years of industry experience as well as ongoing training to offer you the best advice on your next tiling project.\r\n</p>\r\n<p>\r\nWe assign a tile stylist to your project to help you with tile selection, colour coordination and layout, as well as design ideas to inspire any space. Our tile stylists not only take a personal stake in the success of your project, they accept responsibility for your order from start to finish, and long after the cash register has rung.\r\n</p>\r\n<p>\r\nThey establish a clear agreement on what is to be delivered, how delivery will take place, milestone dates and price.  They’re accessible and each has their own computer to quickly retrieve your order information at anytime as required.  They handle the finer details so your experience with us is an enriching one without any hassles.\r\n</p>\r\n<img src="/images/about-us.jpg" alt="The Tile Mob">'),
(3, 0, 3, 0, 0, 0, 0, 0, '', 'New in Store', 'New in Store', 'New in Store', 'new-in-store', 0, '', '<h1>New in Store</h1>\r\n<p>\r\nAt The Tile Mob we’re constantly sourcing new product and researching new and creative ways to enhance your tile project. In a fashion-based business, it’s crucial that we stay on top of the latest trends, both internationally and domestically.\r\n</p>\r\n<p>\r\nPlease browse through our latest range of products below for inspiration, or if you’d like some assistance, please contact us by clicking here.\r\n</p>\r\n<p>\r\nRemember, if it’s happening in Milan, it’s happening at The Tile Mob.\r\n</p>', '<h1>View with Adobe Reader</h1>\r\n<p>\r\n<b>To view a document, click on the thumbnail.</b><br/>\r\nYou will need Adobe Reader to view these documents. If you do not have Adobe Reader, Click here to <a href="http://www.adobe.com/products/reader.html" target="_blank"><b>download.</b></a>\r\n</p>'),
(4, 0, 4, 0, 0, 0, 0, 0, '', 'E3 Performance System', 'E3 Performance System', 'E3 Performance', 'e3-performance-system', 0, '', '<h2>End-to-End Excellence</h2>\r\n<p> The Tile Mob’s exclusive <b>E3 Performance System</b> (<b>E</b>nd-to-<b>E</b>nd <b>E</b>xcellence) ensures you get the right tile for the job in the right quantity at the right time, every time.</p>\r\n<ol>\r\n  <li>We start by dealing with only reputable manufacturers with a proven track record for supplying high grade tiles.</li>\r\n  <li>Then, after receiving an order shipment, we run random samples through an intensive five-part screening process to ensure the tiles we sell will not cause you any problems down the line. The tiles must conform to relevant Australian and international standards as well as pass the following tests before we give them our recognised stamp of approval.\r\n    <table width="100%" border="0" cellspacing="0" cellpadding="0" style="padding:5px;">\r\n      <tr>\r\n        <td width="42" align="left" valign="middle"><img src="/images/Shade-sm.jpg" alt="Shade" width="35" height="34"></td>\r\n        <td height="50" align="left" valign="middle"><strong>Shade</strong> &ndash; Colouration must be  consistent across all tiles as per display samples.</td>\r\n      </tr>\r\n      <tr>\r\n        <td align="left" valign="middle"><img src="/images/Water-sm.jpg" alt="Water" width="35" height="34" /></td>\r\n        <td height="50" align="left" valign="middle"><strong>Water</strong> &ndash; Our water immersion test ensures tiles are protected against water discolouration.</td>\r\n      </tr>\r\n      <tr>\r\n        <td align="left" valign="middle"><img src="/images/Planarity-sm.jpg" alt="Planarity" width="35" height="34" /></td>\r\n        <td height="50" align="left" valign="middle"><strong>Planarity</strong> &ndash; If it&rsquo;s not flat we send it back.&nbsp; We do not accept warped or buckle tiles.</td>\r\n      </tr>\r\n      <tr>\r\n        <td align="left" valign="middle"><img src="/images/Size-sm.jpg" alt="Sizing" width="35" height="34" /></td>\r\n        <td align="left" valign="middle"><strong>Sizing</strong> &ndash; We ensure that size  is consistent between tiles in accordance with standards.</td>\r\n      </tr>\r\n      <tr>\r\n        <td align="left" valign="middle"><img src="/images/Appearance-sm.jpg" alt="Appearance" width="35" height="34" /></td>\r\n        <td height="50" align="left" valign="middle"><strong>Appearance</strong> &ndash; We do not accept tiles with obvious glaze problems and tiles which do not conform to the relevant Australian Standards.</td>\r\n      </tr>\r\n    </table>\r\n  </li>\r\n<li>Once tiles have been approved, we go further than storing our tiles simply by type, we store them by shade/batch (dye lot).  This is because we have found that tile colour may vary fractionally between batches. We do not supply orders made up of mixed batches so you can rely on colour consistency now and in the future.</li>\r\n  <li>We assign an experienced tile stylist to your project to help you with tile selection, colour coordination and layout.  Our tile stylists accept responsibility for your order from start to finish, and long after the cash register has rung.  They establish a clear agreement on what is to be delivered, how delivery will take place, milestone dates and price.</li>\r\n<li>Our advanced order tracking system means you get the right tile, in the right amount at the right time, every time.  All orders are personally checked by your appointed tile stylist prior to delivery. We also archive all orders on computer to assemble an in-depth customer history to assist you when placing repeat or replacement orders in the future.</li>\r\n</ol>\r\n', '<h2>Quality Guaranteed </h2>\r\n<p>Our E3 Performance System works to ensure you receive a guaranteed quality outcome.  We’ve been told by our clients that they use us because we’re so accurate and reliable and we don’t make mistakes. </p>\r\n<p> <b>Note: It is the responsibility of the purchaser to additionally check all Goods supplied before laying/installation/use for correctness of: type, quantity, quality, aesthetics/appearance & suitability of purpose before installation. All Goods are supplied subject to our standard conditions of sale published in detail at <a href="http://www.tilemob.com.au/conditions">www.tilemob.com.au/conditions</a></b> </p>\r\n<img src="/images/e3-image1.jpg" alt="E3 Performance System (End-to-End Excellence)" border="0"/>\r\n<a href="http://www.tilemob.com.au/e3-performance-system"><img src="/images/e3-image2.jpg" alt="Tested Tiles - Quality Guaranteed" border="0"/></a>\r\n<h2>Sales Ethics</h2>\r\n<ol>\r\n<li>We will offer you the best advice on your next tiling project, free from the influence of manufacturers or other incentives.</li>\r\n<li>We will work within your budget and timeframe.</li>\r\n<li>We will rely on proven procedures to avoid mistakes, and ensure that your tile order is supplied exactly as planned.</li>\r\n<li>We will store your tile order for you until a mutually-agreed delivery date.</li>\r\n<li>We will supply the right product for the application (e.g. no wall tiles on floors)\r\n- QUALITY GUARANTEED.</li>\r\n</ol>\r\n'),
(5, 0, 5, 0, 0, 0, 0, 0, '', 'Tiles by Room', 'Tiles by Room', 'Tiles by Room', 'tiles-by-room', 0, '', '<h1>Tiles by Room</h1>\r\n<p>To view a selection of our range of specialty tiles, simply click on an area of interest on the floor plan below.\r\n</p>', ''),
(6, 0, 7, 0, 0, 0, 0, 0, '', 'Contact / Map', 'Contact / Map', 'Contact / Map', 'contact-map', 0, '', '<h1>Contact Us</h1>\r\n\r\n<p>\r\n<u><b>Showroom</b></u><br/>\r\n4-6 Blackwood St (Cnr Samford Rd)<br/>\r\nMitchelton Queensland Australia 4053\r\n</p>\r\n<p>\r\n<u><b>GPS</b></u><br/>\r\nS 27° 24.780''<br/>\r\nE 152° 58.445''\r\n</p>\r\n<p>\r\n<u><b>Hours</b></u><br/>\r\nMon-Fri: 8:30 am - 5:00 pm<br/>\r\nSat: 9:00 am - 2:00 pm<br/>\r\nConsultation outside these hours is available by\r\nappointment.\r\n</p>\r\n<p>\r\n<u><b>Phone</b></u><br/>\r\n(07) 3355 5055</b><br/>\r\nIDD +61 7 3355 5055\r\n</p>\r\n<p>\r\n<u><b>Fax</b></u><br/>\r\n(07) 3355 5399</b><br/>\r\nIDD +61 7 3355 5399\r\n</p>\r\n<p>\r\n<u><b>After Hours</b></u><br/>\r\n0412 196 115<br/>\r\nIDD +61 412 196 115\r\n</p>\r\n<p>\r\n<u><b>Email</b></u><br/>\r\n<a href="mailto:sales@tilemob.com.au">sales@tilemob.com.au</a>\r\n</p>\r\n<p>\r\n<u><b>Postal</b></u><br/>\r\nP.O. Box 6121, Mitchelton QLD Australia 4053\r\n</p>', '<h1>Map</h1>\r\n<p>\r\n<a href="#" onClick="window.open(''viewmap.php'','''',''status=yes,width=770,height=650,scrollbars=yes'');"><b>Please click on the below map to find directions to our Showroom</b></a>\r\n</p>\r\n<a href="#" onClick="window.open(''viewmap.php'','''',''status=yes,width=770,height=650,scrollbars=yes'');"><img src="images/tile-mob-map.gif" alt="The Tile Mob location" width="475" height="165" border="0"></a>\r\n<img src="images/the-tile-mob-location3.jpg" alt="Come visit The Tile Mob" />\r\n<img src="images/Tile-Mob-Team.jpg" alt="The Tile Mob">'),
