(11, 0, 99, 0, 0, 1, 0, 0, '', 'Careers', 'Careers', 'Careers', 'careers', 0, '', '<h1>Career Opportunities</h1>\r\n<h2>About Us</h2>\r\n<p>\r\nThe Tile Mob was founded in 1976 as a tile retailer that would be different from others in two main ways:</p>\r\n<p>\r\n1). We would supply tiles from the best manufacturers in Australia and around the world and<br/>\r\n2). We would back it up with sales and technical advice that was second to none.</li>\r\n</p>\r\n<p>\r\n<img src="/images/Tile-Mob-Team.jpg" alt="The Tile Mob" align="right" width="174" height="223" />Through these goals, we have become recognised as one of Brisbane’s finest tile suppliers. As a family-owned independent trader, we are not linked to any single manufacturer or wholesaler so can offer the best advice on your tiling project.\r\n</p>\r\n<p>\r\nDiscerning homeowners, interior decorators and architects turn to our vast selection of wall and floor tiles sourced from high-tech international and Australian factories through to single-artist studios to create residential and commercial spaces of distinction.  What’s more, you may browse through a range of elegant marble panels, hand-painted murals and decorative border tiles in a plethora of styles - from contemporary stainless steel and metal to sophisticated glass & marble listellos.\r\n</p>\r\n<p>\r\nRegardless of your project’s size or complexity, turn to The Tile Mob to get the right tile for the right job, every time.  We’re big enough to provide global best practice yet small enough to take a personal stake in your project.\r\n</p>', '<div style="border:1px solid #DDDDDD;background:#EEEEEE;margin:15px;margin-bottom:0;padding:10px;"><p>If you are an experienced tile salesperson with the drive to succeed, The Tile Mob would like to talk to you!  We are looking to create the following positions for the right candidates to join our existing <a href="http://www.tilemob.com.au/contact-map/">Mitchelton Showroom</a> sales team in Brisbane:</p>\r\n                    <ul>\r\n                      <li><a href="http://www.tilemob.com.au/careers/casual.php"><strong>Casual Tile Showroom Salesperson</strong></a></li>\r\n                      <li><a href="http://www.tilemob.com.au/careers/full-time.php"><strong>Full-time Tile Showroom Salesperson</strong></a></li>\r\n                      <li ><a href="http://www.tilemob.com.au/careers/trade-and-specifier.php"><strong>Trade & Specifier Tile Sales Representative </strong></a></li>\r\n                    </ul>\r\n                  </div>'),
(12, 0, 99, 0, 0, 1, 0, 0, '', 'Privacy Policy', 'Privacy Policy', 'Privacy Policy', 'privacy-policy', 0, '', '<h1>Website Privacy Policy</h1>\r\n\r\n<p>This privacy policy statement has been made in accordance with amendments to the Australian Federal Government Privacy Amendment (Private Sector) Act 2000 (New Privacy Laws) which took effect from 21 December 2001.</p>\r\n\r\n<h2>Information collected</h2>\r\n\r\n<p>When you look at the Web site of The Tile Mob, we make a record of your visit and logs the following information for statistical purposes:</p>\r\n\r\n<ul>\r\n<li>your server address</li>\r\n<li>your top level domain name (for example .com, .gov, .au, .uk etc)</li>\r\n<li>the pages you accessed and documents downloaded</li>\r\n<li>the previous site you have visited</li>\r\n<li>the type of browser you are using.</li>\r\n</ul>\r\n\r\n<h2>Access to information collected</h2>\r\n\r\n<p>The Tile Mob will not make an attempt to identify users or their browsing activities. However, in the unlikely event of an investigation, a law enforcement agency or other government agency may exercise its legal authority to inspect our Internet Service Provider''s logs.</p>\r\n\r\n<h2>Use and disclosure of information collected</h2>\r\n\r\n<p>Our Office will only record your e-mail address if you send us a message. Your e-mail address will only be used or disclosed for the purpose for which you have provided it and it will not be added to a mailing list or used or disclosed for any other purpose without your consent.  </p>\r\n<p>Users are advised that there are inherent risks transmitting information across the Internet.  </p>\r\n', '<h2>Cookies  </h2>\r\n<p>This Website uses temporary cookies. Cookies are non-harmful data files placed on the user''s computer hard drive, and it allows The Tile Mob to determine if the user is a return customer whenever the user visits the Web site again. These data files may also be used to review how a user uses a Web site or to personalize the Website for the user''s browsing experience. Browsers usually accept cookies automatically, but users may change their browser settings so that cookies can only be accepted by clicking on an accept button.  </p>\r\n<p>Cookies can be either "persistent" or "session" based. Persistent cookies are stored on your computer, contain an expiration date, and may be used to track your browsing behaviour upon return to the issuing Web site. Session cookies are short-lived, are used only during a browsing session, and expire when you quit your browser.  </p>\r\n<p>Cookies from The Tile Mob can be manually cleared or deleted from the user''s computer hard drive via the options or preferences in their Internet Browser.  </p>\r\n<hr/>\r\n<h1>Contact this Office  </h1>\r\n<p>The Tile Mob  <br />\r\n  4-6 Blackwood St (Cnr Samford Rd)\r\n    <br />\r\n  Mitchelton Queensland Australia 4053</p>\r\n<p>Phone: +61 7 3355 5055\r\n  <br />\r\n  Fax: +61 7 3355 5399  </p>\r\n<p>Email: <a href="mailto:sales@tilemob.com.au">sales@tilemob.com.au</a></p>\r\n'),
(13, 0, 99, 0, 0, 1, 0, 0, '', 'Disclaimer', 'Disclaimer', 'Disclaimer', 'disclaimer', 0, '', '<h1>Website Disclaimer</h1>\r\n<h2>Use of this site </h2>\r\n<p>The Tile Mob Pty Ltd (The Tile Mob) is the owner and operator of <a href="http://www.tilemob.com.au/">this Website</a>. </p>\r\n<p>Users of this Site (Users) agree  to be bound by these Terms &amp; Conditions, which are subject to change  at The Tile Mob&rsquo;s sole discretion. Your use of and access to this Site  indicates your acceptance of these Terms &amp; Conditions, as they exist  at that time. </p>\r\n<p>Although The Tile Mob has made  every effort to produce information on this website that is current,  informative and accurate The Tile Mob cannot guarantee or warrant this  information is accurate or complete at any one particular time. </p>\r\n<p>The Tile Mob makes no  representations or warranties of any kind, express or implied, as to the  operation of the site or the information, content or details disclosed  on this site.</p>\r\n<h2>Liability &amp; Indemnity</h2>\r\n<p>The Tile Mob does not warrant the  accuracy of the content on the Site. The content is provided to you &ldquo;as  is&rdquo; and on an &ldquo;as available&rdquo; basis and on the condition that you  undertake all responsibility for assessing the accuracy of the content  and rely on it at your own risk. All content on the Site may be changed  at The Tile Mob&rsquo;s sole discretion and without notice.</p>\r\n<p>The Tile Mob will have no  responsibility or liability in relation to any loss or damage that you  incur, including damage to your software or hardware, arising from your  use of or access to this Site.</p>\r\n<p>The Tile Mob does not warrant that  functions contained in the Site content, such as hyperlinks, will be  uninterrupted or error free, that defects will be corrected or that The  Tile Mob or the server that makes it available, are free of viruses or  bugs.</p>\r\n<p>You indemnify The Tile Mob and its  affiliated companies, and the directors, officers, employees and agents  against any action, claim, loss or expense which it incurs which arises  from your use of the <a href="http://www.tilemob.com.au/">Tile Mob website.</a></p>\r\n', '<h2>Third Party Content &amp; Links</h2>\r\n<p>This Site may include third party  content, which is subject to that third party''s terms and conditions of  use. Nothing on this Site should be construed as granting any licence or  right for you to use that content.</p>\r\n<p>This Site may include links to  third party sites which are not related to The Tile Mob and in relation  to which The Tile Mob has no control or interest. The appearance of  those links on this site does not indicate any relationship between The  Tile Mob and that third party or any endorsement by The Tile Mob of that  third party, its site or the products or services which it is  advertising on this Site.</p>\r\n<h2>General</h2>\r\n<p>All correspondence with The Tile Mob via online forms, links or email client is conducted according to The Tile Mob &ldquo;<a href="http://www.tilemob.com.au/privacy-policy/">Privacy Policy</a>&rdquo;.</p>\r\n<p>Products on The Tile Mob Website  have been photographed to represent colour and pattern as close to the  actual product as possible. However The Tile Mob cannot guarantee how  the images represent on a users own computer and monitor and accepts no  responsibility for accuracy of pattern, colour, shape, texture or size  of products portrayed on the Site. It is the sole responsibility of the  user to perform their own due diligence in respect to making a final  purchase from The Tile Mob.</p>\r\n'),
(14, 0, 6, 0, 0, 0, 0, 0, '', 'Interactive Gallery', 'Interactive Gallery', 'Interactive Gallery', 'tm_catalogue', 0, '', '<h1>Interactive Gallery</h1>', ''),
(15, 0, 99, 0, 0, 1, 0, 0, '', 'Casual Tile Showroom Salesperson', 'Casual Tile Showroom Salesperson', 'Casual Tile Showroom Salesperson', 'casual', 0, '', '<h1>Casual Tile Showroom Salesperson</h1>\r\n<table width="100%" border="0" align="center" cellpadding="0" cellspacing="0" style="padding:5px;">\r\n                    <tr>\r\n                      <td width="120" valign="top"><strong>Employment Type:</strong></td>\r\n                      <td valign="top">Casual</td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Location:</strong></td>\r\n\r\n                      <td valign="top"><a href="http://www.tilemob.com.au/">The Tile Mob Pty Ltd<br />\r\n                        4-6 Blackwood St (Cnr Samford Rd), MITCHELTON QLD 4053</a></td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Description:</strong></td>\r\n                      <td valign="top">Do you have proven sales experience in a retail tile showroom?  Do you have a strong work ethic, good organisational skills, high standards and enjoy helping people find the right tiles?  Do you have excellent communication skills, a flair for colours and the ability to deliver a premium customer service experience?<br/><a href="http://www.tilemob.com.au/about-us/">The Tile Mob at MITCHELTON</a> is looking to create 1 Casual Showroom Sales position for a truly impressive candidate to join our existing professional sales team. </td>\r\n\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>General:</strong></td>\r\n                      <td valign="top"><strong>The successful candidate will have an opportunity to work in an environment offering:</strong><br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> State-of-the-art Windows-based software systems including: stock &amp; order tracking, instant retrieval of historical customer records, full electronic communications.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> <a href="http://www.tilemob.com.au/tm_catalogue/">A fantastic mix of products</a> displayed in our boutique-style showroom including: quality wall &amp; floor tiles, stone, mosaics, slate tiles &amp; terracotta &ndash; imported directly by our company and/or sourced through our extensive network of Australian suppliers.<br />\r\n\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Direct control over your own orders, including any required inward purchases &amp; final delivery to site. <br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> A small, skilled team of career-minded colleagues with industry experience ranging from 7-25 years.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Direct access to supportive senior management who are in attendance 100% of opening hours.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> All operations supported by an efficiently-run warehouse with industry-leading stock control, accuracy &amp; order-supply response times.<br />\r\n\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> A culture of staff consultation where ideas to improve our company are encouraged &amp; welcomed.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> An independent trader/single-branch operation where decisions are made &amp; implemented swiftly without needing to refer back to a head office for approval.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Close proximity to public transport with the <a href="http://www.translink.com.au/" target="_blank">Mitchelton bus/rail interchange</a> less than a 5 minute walk.<br />\r\n\r\n                      <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> A proud history of stability &amp; service from the <a href="http://www.tilemob.com.au/contact-map/">same location in Mitchelton since 1976.</a></td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Duties:</strong></td>\r\n                      <td valign="top"><strong>The successful candidate will undertake functions including:</strong><br />\r\n\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Welcoming customers into our showroom and assisting them to select tiles and related materials for their building projects.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Handling of telephone &amp; internet enquiries.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Product quantity estimation from technical drawings.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Price quoting &amp; negotiation.<br />\r\n\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Cash &amp; receipts handling, invoicing, purchase order entry.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Arranging delivery of goods to customers.<br />\r\n                      <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> General showroom presentation upkeep, display maintenance.</td>\r\n                    </tr>\r\n                    <tr>\r\n\r\n                      <td valign="top"><strong>Qualifications:</strong></td>\r\n                      <td valign="top">Strong candidates for this position will have at least three (3) years of recent tile showroom sales experience or equivalent wholesale tile experience.  A basic understanding of PCs running <a href="http://www.microsoft.com/windowsxp/pro/default.mspx" target="_blank">Microsoft Windows</a> is necessary.</td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Remuneration:</strong></td>\r\n                      <td valign="top">By negotiation.  Package negotiated will be commensurate with the candidate&rsquo;s experience and skill set.</td>\r\n\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top">&nbsp;</td>\r\n                      <td valign="top"><p><img src="/images/Tile-Mob-Team.jpg" alt="The Tile Mob" width="174" height="223" /></p>\r\n                      <p>If you believe that through your previous experience in tiles you have something to offer our company, we would be most interested in talking about what we can offer you.  Confidential enquiries can be made via e-mail to <a href="mailto:sean@tilemob.com.au">sean@tilemob.com.au</a> or telephone Sean on 0412 196 115.</p></td>\r\n                    </tr>\r\n                </table>', ''),
(16, 0, 99, 0, 0, 1, 0, 0, '', 'Full-time Tile Showroom Salesperson', 'Full-time Tile Showroom Salesperson', 'Full-time Tile Showroom Salesperson', 'full-time', 0, '', '<h1>Full-time Tile Showroom Salesperson</h1>\r\n<table width="100%" border="0" align="center" cellpadding="0" cellspacing="0" style="padding:5px;">\r\n                    <tr>\r\n                      <td width="120" valign="top"><strong>Employment Type:</strong></td>\r\n                      <td valign="top">Permanent Full-Time</td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Location:</strong></td>\r\n\r\n                      <td valign="top"><a href="http://www.tilemob.com.au/">The Tile Mob Pty Ltd<br />\r\n                        4-6 Blackwood St (Cnr Samford Rd), MITCHELTON QLD 4053</a></td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Description:</strong></td>\r\n                      <td valign="top">Do you have proven sales experience in a retail tile showroom?  Do you have a strong work ethic, good organisational skills, high standards and enjoy helping people find the right tiles?  Do you have excellent communication skills, a flair for colours and the ability to deliver a premium customer service experience?<br/><a href="http://www.tilemob.com.au/about-us/">The Tile Mob at MITCHELTON</a> is looking to create 1 Full-Time Showroom Sales position for a truly impressive candidate to join our existing professional sales team. </td>\r\n\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>General:</strong></td>\r\n                      <td valign="top"><p><strong>The successful candidate will have an opportunity to work in an environment offering:</strong><br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> State-of-the-art Windows-based software systems including: stock &amp; order tracking, instant retrieval of historical customer records, full electronic communications.<br />\r\n                          <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> <a href="http://www.tilemob.com.au/tm_catalogue/">A fantastic mix of products</a> displayed in our boutique-style showroom including: quality wall &amp; floor tiles, stone, mosaics, slate tiles &amp; terracotta &ndash; imported directly by our company and/or sourced through our extensive network of Australian suppliers.<br />\r\n\r\n                          <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Direct control over your own orders, including any required inward purchases &amp; final delivery to site. <br />\r\n                          <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> A small, skilled team of career-minded colleagues with industry experience ranging from 7-25 years.<br />\r\n                          <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Direct access to supportive senior management who are in attendance 100% of opening hours.<br />\r\n                          <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> All operations supported by an efficiently-run warehouse with industry-leading stock control, accuracy &amp; order-supply response times.<br />\r\n\r\n                          <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> A culture of staff consultation where ideas to improve our company are encouraged &amp; welcomed.<br />\r\n                          <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> An independent trader/single-branch operation where decisions are made &amp; implemented swiftly without needing to refer back to a head office for approval.<br />\r\n                          <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Close proximity to public transport with the <a href="http://www.translink.com.au/" target="_blank">Mitchelton bus/rail interchange</a> less than a 5 minute walk.<br />\r\n\r\n                          <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> A proud history of stability &amp; service from the <a href="http://www.tilemob.com.au/contact-map/">same location in Mitchelton since 1976.</a></p>                      </td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Duties:</strong></td>\r\n                      <td valign="top"><strong>The successful candidate will undertake functions including:</strong><br />\r\n\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Welcoming customers into our showroom and assisting them to select tiles and related materials for their building projects.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Handling of telephone &amp; internet enquiries.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Product quantity estimation from technical drawings.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Price quoting &amp; negotiation.<br />\r\n\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Cash &amp; receipts handling, invoicing, purchase order entry.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Arranging delivery of goods to customers.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Keeping in contact with a roster of trade &amp; specifier clients.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Liaison with local and interstate suppliers.<br />\r\n\r\n                      <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> General showroom presentation upkeep, display maintenance.</td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Qualifications:</strong></td>\r\n                      <td valign="top">Strong candidates for this position will have at least three (3) years of recent tile showroom sales experience or equivalent wholesale tile experience.  A basic understanding of PCs running <a href="http://www.microsoft.com/windowsxp/pro/default.mspx" target="_blank">Microsoft Windows</a> is necessary.<br />\r\n\r\n                      An unrestricted <a href="http://www.transport.qld.gov.au/Home/Licensing/Driver_licence/" target="_blank">car licence</a> is also required.</td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Remuneration:</strong></td>\r\n                      <td valign="top">By negotiation.  Package negotiated will be commensurate with the candidate&rsquo;s experience and skill set.</td>\r\n\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top">&nbsp;</td>\r\n                      <td valign="top"><p><img src="/images/Tile-Mob-Team.jpg" alt="The Tile Mob" width="174" height="223" /></p>\r\n                      <p>If you believe that through your previous experience in tiles you have something to offer our company, we would be most interested in talking about what we can offer you.  Confidential enquiries can be made via e-mail to <a href="mailto:sean@tilemob.com.au">sean@tilemob.com.au</a> or telephone Sean on 0412 196 115.</p></td>\r\n                    </tr>\r\n                </table>', ''),
(17, 0, 99, 0, 0, 1, 0, 0, '', 'Trade & Specifier Tile Sales Representative ', 'Trade & Specifier Tile Sales Representative ', 'Trade & Specifier Tile Sales Representative ', 'trade-and-specifier', 0, '', '<h1>Trade & Specifier Tile Sales Representative </h1>\r\n<table width="100%" border="0" align="center" cellpadding="0" cellspacing="0" style="padding:5px;">\r\n                    <tr>\r\n                      <td width="120" valign="top"><strong>Employment Type:</strong></td>\r\n                      <td valign="top">Permanent Full-Time</td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Location:</strong></td>\r\n\r\n                      <td valign="top"><a href="http://www.tilemob.com.au/">The Tile Mob Pty Ltd<br />\r\n                        4-6 Blackwood St (Cnr Samford Rd), MITCHELTON QLD 4053</a></td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Description:</strong></td>\r\n                      <td valign="top">Do you have proven sales experience the tile industry?  Do you have a strong work ethic, good organisational skills, high standards and enjoy helping the Trade &amp; Specifier market find the right tiles for their projects?  Do you have excellent communication skills, a flair for colours and the ability to deliver a premium customer service experience?  <a href="http://www.tilemob.com.au/about-us/">The Tile Mob at MITCHELTON</a> is looking to create 1 Full-Time Trade &amp; Specifier Sales Representative position among our professional sales team for an impressive candidate.</td>\r\n\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>General:</strong></td>\r\n                      <td valign="top"><p><strong>The successful candidate will have an opportunity to work in an environment offering:</strong><br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> State-of-the-art Windows-based software systems including: stock &amp; order tracking, instant retrieval of historical customer records, full electronic communications.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> <a href="http://www.tilemob.com.au/tm_catalogue/">A fantastic mix of products</a> displayed in our boutique-style showroom including: quality wall &amp; floor tiles, stone, mosaics, slate tiles &amp; terracotta &ndash; imported directly by our company and/or sourced through our extensive network of Australian suppliers.<br />\r\n\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Direct control over your own orders, including any required inward purchases &amp; final delivery to site. <br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> A small, skilled team of career-minded colleagues with industry experience ranging from 7-25 years.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Direct access to supportive senior management who are in attendance 100% of opening hours.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> All operations supported by an efficiently-run warehouse with industry-leading stock control, accuracy &amp; order-supply response times.<br />\r\n\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> A culture of staff consultation where ideas to improve our company are encouraged &amp; welcomed.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> An independent trader/single-branch operation where decisions are made &amp; implemented swiftly without needing to refer back to a head office for approval.<br />\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> Full administrative, sampling &amp; office backup when you&rsquo;re &ldquo;on-the-road&rdquo;. <br />\r\n\r\n                        <img src="/images/bullet-arrow.gif" alt="Visit the Tile Mob" width="12" height="12" border="0" align="absmiddle" style="margin-top:5px;"/> A proud history of stability &amp; service from the <a href="http://www.tilemob.com.au/contact-map/">same location in Mitchelton since 1976.</a></p>\r\n                      </td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Duties:</strong></td>\r\n                      <td valign="top"><p>The primary focus of the successful candidate will be to establish and maintain new &amp; existing relationships with our customer base in the trade, builder, commercial &amp; specifier market segment. This customer base includes but is not limited to: architects, designers, property managers, builders, tile layers and other related industry professionals. </p>\r\n\r\n                        <p>Using a separate office at our <a href="http://www.tilemob.com.au/contact-map/">Mitchelton showroom</a> as a base, the successful candidate will make outward visits to clients in the greater-Brisbane area, promoting our product range and gaining specifications &amp; sales of those products for our company.  Meeting clients in our Mitchelton showroom on an <a href="http://www.tilemob.com.au/visitus/">appointment basis</a> may also be required.</p>\r\n                      <p>The Trade &amp; Specifier Sales Representative will work in consulatation with our General Manager as well as work independently.</p></td>\r\n                    </tr>\r\n\r\n                    <tr>\r\n                      <td valign="top"><strong>Qualifications:</strong></td>\r\n                      <td valign="top">Strong candidates for this position will have at least three (3) years of recent tile sales experience or equivalent experience representing other building materials to the Trade &amp; Specifier market.<br />\r\n                        The ability to make product quantity estimation from technical drawings &amp; on sites is essential.   A basic understanding of PCs running <a href="http://www.microsoft.com/windowsxp/pro/default.mspx" target="_blank">Microsoft Windows</a> is necessary.<br />\r\n\r\n                      An unrestricted <a href="http://www.transport.qld.gov.au/Home/Licensing/Driver_licence/" target="_blank">car licence</a> is also required.</td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top"><strong>Remuneration:</strong></td>\r\n                      <td valign="top">By negotiation.  Package negotiated will be commensurate with the candidate&rsquo;s experience and skill set.<br />\r\n\r\n                        <strong>A fully-maintained FBT-exempted company motor vehicle and a <a href="http://www.au.blackberry.com/" target="_blank">smart phone</a> and notebook computer is included in the package.</strong></td>\r\n                    </tr>\r\n                    <tr>\r\n                      <td valign="top">&nbsp;</td>\r\n                      <td valign="top"><p><img src="/images/Tile-Mob-Team.jpg" alt="The Tile Mob" width="174" height="223" /></p>\r\n                      <p>If you believe that through your previous experience in tiles you have something to offer our company, we would be most interested in talking about what we can offer you.  Confidential enquiries can be made via e-mail to <a href="mailto:sean@tilemob.com.au">sean@tilemob.com.au</a> or telephone Sean on 0412 196 115.</p></td>\r\n\r\n                    </tr>\r\n                </table>', ''),
