(5, 0, 99, '', '', '', 'TERMS & CONDITIONS', '', 'Terms & Conditions', 'terms-and-conditions.php', '', 1, 0, '<ol start="1" type="1">\r\n	<li>\r\n		<h2>\r\n			<strong>Definitions</strong></h2>\r\n	</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		&ldquo;Seller&rdquo; shall mean <a href="http://www.tilesbrisbane.com.au/">TilesBrisbane.com.au</a> its successors and assigns or any person acting on behalf of and with the authority of <a href="http://www.tilesbrisbane.com.au/">TilesBrisbane.com.au</a>.</li>\r\n	<li>\r\n		&ldquo;Buyer&rdquo; shall mean the Purchaser (or any person acting on behalf of and with the authority of the Purchaser) as described on any quotation, details entered through our website online forms, work authorisation, invoice, sales order, order confirmation, tile enquiry, tile estimate/quote, authority to hire or other form as provided by the Seller to the Buyer.</li>\r\n	<li>\r\n		&ldquo;Equipment&rdquo; shall mean all Equipment including any accessories supplied on hire by the Seller to the Buyer (and where the context so permits shall include any supply of services). The Equipment shall be as described on the invoices, quotations, sales orders, order confirmations, tile enquiries, tile estimates/quotes, authority to hire or any other work authorisations form provided by the Seller to the Buyer.</li>\r\n	<li>\r\n		&ldquo;Goods&rdquo; shall mean Goods supplied by the Seller to the Buyer including but not limited to: ceramic tiles, porcelain tiles, natural stone tiles, mosaic tiles, glass tiles, adhesives, sealers and Goods incidental to installation of tiles (and where the context so permits shall include any supply of Services as hereinafter defined) and are as described on the invoices, quotations, sales orders, order confirmations, tile enquiries, tile estimates/quotes, authority to hire or any other work authorisations form as provided by the Seller to the Buyer.</li>\r\n	<li>\r\n		&ldquo;Services&rdquo; shall mean all Services supplied by the Seller to the Buyer and includes any advice or recommendations (and where the context so permits shall include any supply of Goods as defined above).</li>\r\n	<li>\r\n		&ldquo;Price&rdquo; shall mean the Price payable for the Goods as agreed between the Seller and the Buyer in accordance with clause 4 of this contract.</li>\r\n</ol>\r\n<ol start="2" type="1">\r\n	<li>\r\n		<h2>\r\n			<strong>The Commonwealth Trade Practices Act 1974 (&ldquo;TPA&rdquo;) and Fair Trading Acts (&ldquo;FTA&rdquo;)</strong></h2>\r\n	</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		Nothing in this agreement is intended to have the effect of contracting out of any applicable provisions of the TPA or the FTA in each of the States and Territories of Australia, except to the extent permitted by those Acts where applicable.</li>\r\n</ol>\r\n<ol start="3" type="1">\r\n	<li>\r\n		<h2>\r\n			<strong>Acceptance</strong></h2>\r\n	</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		The completion of a purchase through the checkout of <a href="http://www.tilesbrisbane.com.au">www.tilesbrisbane.com.au</a> and any instructions received by the Seller from the Buyer for the supply of Goods and/or the Buyer&rsquo;s acceptance of Goods supplied by the Seller shall constitute acceptance of the terms and conditions contained herein.</li>\r\n	<li>\r\n		The Buyer acknowledges and agrees that Prices quoted are structured on a per piece basis and where applicable a covered square meter price is given to take into account industry accepted norms for jointing requirements.</li>\r\n	<li>\r\n		Where the Seller gives advice, recommendations, information, assistance or service to the Buyer or the Buyer&rsquo;s agent, regarding the Goods or Services then it is given in good faith and the Seller shall not be liable in any way whatsoever for any damages, losses or costs however arising resulting from the Buyer relying on the same.</li>\r\n	<li>\r\n		Where more than one Buyer has entered into this agreement, the Buyers shall be jointly and severally liable for all payments of the Price.</li>\r\n	<li>\r\n		Upon acceptance of these terms and conditions by the Buyer the terms and conditions are binding and can only be amended with the written consent of the Seller.</li>\r\n	<li>\r\n		Goods are supplied by the Seller only on the terms and conditions of trade herein to the exclusion of anything to the contrary in the terms of the Buyer&rsquo;s order notwithstanding that any such order is placed on terms that purport to override these terms and conditions of trade, unless such terms and conditions have been agreed to in writing in advance by the Seller.</li>\r\n</ol>\r\n<ol start="4" type="1">\r\n	<li>\r\n		<h2>\r\n			<a id="_Ref142793213" name="_Ref142793213"></a><strong>Price and Payment</strong></h2>\r\n	</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		At the Seller&rsquo;s sole discretion the Price shall be in Australian Dollars (AUD$) inclusive of GST (if applicable) either:</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		Published on the Seller&rsquo;s website and shown on invoices, sales orders, order confirmations (all of which are always issued on an E&amp;OE basis) provided by the Seller to the Buyer in respect of Goods supplied.</li>\r\n</ol>\r\n<p>\r\n	<a id="_Ref142792390" name="_Ref142792390"></a>All pricelists and prices published on the Seller&rsquo;s website:</p>\r\n<ol start="1" type="1">\r\n	<li>\r\n		are issued on an Errors &amp; Omissions Excepted (E&amp;OE) basis; and</li>\r\n	<li>\r\n		supersede all previous pricelists which have an earlier issue date; and</li>\r\n	<li>\r\n		are subject to change without notice; and</li>\r\n	<li>\r\n		are not to be construed as an offer; and any item not included on a pricelist should be considered unavailable, deleted or discontinued.</li>\r\n</ol>\r\n<p>\r\n	The Seller reserves the right to change the Price in the event of a variation to the Seller&rsquo;s quotation. Any variation from the plan of scheduled works or specifications (including, but not limited to, any variation due to unforeseen circumstances, or as a result of fluctuations in the currency exchange rate, government charges, or due to ocean freight charges being incurred, or as a result of increases to the Seller in the cost of finished goods, materials and labour) will be charged for on the basis of the Seller&rsquo;s quotation and will be shown as variations on the invoice. Payment for all variations must be made in full at their time of completion.</p>\r\n<p>\r\n	At the Seller&rsquo;s sole discretion a deposit may be required for an order to be confirmed.</p>\r\n<p>\r\n	At the Seller&rsquo;s sole discretion:</p>\r\n<ol start="1" type="1">\r\n	<li>\r\n		Payment shall be due at the time of ordering and before delivery or pickup of the Goods through our secure online payment gateway.</li>\r\n</ol>\r\n<p>\r\n	Any credit card used must be by, and with the authority of, the named holder/owner of that credit card and in a non-fraudulent manner.</p>\r\n<p>\r\n	Time for payment for the Goods shall be of the essence and will be stated on the invoice or any other forms. If no time is stated then payment shall be due before delivery of the Goods.</p>\r\n<p>\r\n	Payment will be made by cash, or by cheque, or by bank cheque, or by credit card (plus a surcharge of up to two and a half percent (2.5%) of the Price (waived at the discretion of the seller)), or by direct credit, PayPal or by any other method as agreed to between the Buyer and the Seller.</p>\r\n<p>\r\n	GST where applicable is included in the Price.</p>\r\n<ol start="5" type="1">\r\n	<li>\r\n		<h2>\r\n			<strong>Delivery of Goods</strong></h2>\r\n	</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		No purchase made via <a href="http://www.tilesbrisbane.com.au">www.tilesbrisbane.com.au</a> shall be deemed confirmed until the Buyer receives a stock-fulfilment &ldquo;Order Confirmation&rdquo; email from the Seller.&nbsp; In the event your ordered product is unavailable, tilesbrisbane will inform you via email and offer a similar or substitute product or refund any deposit or monies paid.</li>\r\n	<li>\r\n		All product weights, packaging sizes &amp; packaging dimensions shown on our website are indicative only and are subject to change without notice.</li>\r\n	<li>\r\n		All Goods, unless specifically noted, are sold &ldquo;ex store&rdquo; on a &ldquo;freight forward&rdquo; basis and are transported at the Buyer&rsquo;s risk and expense. The Buyer is responsible for arranging insurance for the Goods. The Seller&rsquo;s responsibility for damage to, or shortage of, the Goods ceases upon dispatch or pickup from the Seller&rsquo;s premises.</li>\r\n	<li>\r\n		The Seller reserves the right to subcontract commercial carriers to deliver Goods on the Buyer&rsquo;s behalf and at the Buyer&rsquo;s risk.</li>\r\n	<li>\r\n		At the Seller&rsquo;s sole discretion delivery of the Goods shall take place when the Buyer takes possession of the Goods at the Buyer&rsquo;s nominated address (in the event that the Goods are delivered by the Seller or the Seller&rsquo;s nominated carrier).</li>\r\n	<li>\r\n		At the Seller&rsquo;s sole discretion the costs of delivery are in addition to the Price and, where applicable, charged to the Buyer&rsquo;s account.</li>\r\n	<li>\r\n		The Buyer shall make all arrangements necessary to take delivery of the Goods whenever they are tendered for delivery. In the event that the Buyer is unable to take delivery of the Goods as arranged then the Seller shall be entitled to charge a reasonable fee for redelivery.</li>\r\n	<li>\r\n		Delivery of the Goods to a third party nominated by the Buyer is deemed to be delivery to the Buyer for the purposes of this agreement.</li>\r\n	<li>\r\n		The Seller may deliver the Goods by separate instalments. Each separate instalment shall be invoiced and paid in accordance with the provisions in these terms and conditions.</li>\r\n	<li>\r\n		The failure of the Seller to deliver shall not entitle either party to treat this contract as repudiated.</li>\r\n	<li>\r\n		The Seller shall not be liable for any loss or damage whatsoever due to failure by the Seller to deliver the Goods (or any of them) promptly or at all, where due to circumstances beyond the control of the Seller.</li>\r\n	<li>\r\n		The delivery records of the Seller shall be prima facie proof of delivery of the Goods to the Buyer of the quantity and description stated therein, in good order and condition, and the Buyer&rsquo;s receipt thereof in the same condition.</li>\r\n</ol>\r\n<ol start="6" type="1">\r\n	<li>\r\n		<h2>\r\n			<strong>Risk</strong></h2>\r\n	</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		If the Seller retains ownership of the Goods nonetheless, all risk for the Goods passes to the Buyer on delivery.</li>\r\n	<li>\r\n		If any of the Goods are damaged or destroyed following delivery but prior to ownership passing to the Buyer, the Seller is entitled to receive all insurance proceeds payable for the Goods. The production of these terms and conditions by the Seller is sufficient evidence of the Seller&rsquo;s rights to receive the insurance proceeds without the need for any person dealing with the Seller to make further enquiries.</li>\r\n	<li>\r\n		Where the Buyer expressly requests the Seller to leave Goods outside the Seller&rsquo;s premises for collection or to deliver the Goods to an unattended location then such Goods shall be left at the Buyer&rsquo;s sole risk and it shall be the Buyer&rsquo;s responsibility to ensure the Goods are insured adequately or at all.</li>\r\n	<li>\r\n		If delivery is delayed as a consequence of the Buyer&rsquo;s instructions, or lack thereof, then the Seller may at its sole discretion, store the Goods for the Buyer (at the Buyer&rsquo;s risk) and the Buyer shall be liable for all storage costs charged or incurred by the Seller and in the event that the Goods are stored elsewhere all cartage charges incurred by the Seller.</li>\r\n	<li>\r\n		The Buyer acknowledges:</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		and agrees that:</li>\r\n</ol>\r\n<ol start="1" type="i">\r\n	<li>\r\n		pallet, container and indent prices, where given, are not to be construed as quotations and the Seller reserves the right to withdraw or vary such prices; and</li>\r\n	<li>\r\n		the Seller recommends that immediately after installing or applying the Goods, suitable protective measures be taken to avoid unnecessary damage to the Goods. The Seller shall not be held liable for any loss, damages, or costs however resulting from tile and other goods becoming scratched by foreign abrasive material, stained or contaminated with foreign substances during or after installation or application; and</li>\r\n	<li>\r\n		any boards, stands, samples or promotional hardware provided by the Seller to the Buyer are on a loan only basis and will remain the property of the Seller and must be available for return upon request. The Buyer shall be liable for any loss, damages or costs however resulting to the promotional hardware while on loan in the Buyer&rsquo;s possession</li>\r\n</ol>\r\n<p>\r\n	samples of Goods are supplied as a guide only; and</p>\r\n<p>\r\n	that shade and size variation is inherent in all kiln-fired products including ceramic, glass, porcelain and terracotta tiles and may be evident between shipments of particular Goods, or even among Goods of one type from the same shipment; and</p>\r\n<p>\r\n	that ceramic glazes are not guaranteed against crazing.</p>\r\n<p>\r\n	The Buyer acknowledges that:</p>\r\n<ol start="1" type="1">\r\n	<li>\r\n		Goods supplied may exhibit variations in shade, colour, durability, texture, size, weight, dimensions, surface and finish, and may fade or change colour over time. The Seller will make every effort to match batches of product supplied, or to match batches of product to sales samples, catalogues, marketing literature or website images in order to minimise such variations but shall not be liable in any way whatsoever where such variations occur; and</li>\r\n	<li>\r\n		all Goods made from natural products including but not limited to: terracotta, wood, stone, slate, marble, sandstone and granite are sold on the basis that they are man-manipulated (but not man-made) and are therefore sold with no guarantee or warranty whatsoever. Such Goods may exhibit significant variations in colour, physical dimensions, density, surface texture, slip-resistance and markings, veining and pattern from one piece to the next; and</li>\r\n	<li>\r\n		any Goods produced through polishing, grinding or honing processes may, with varying light sources and at differing angles, display optical effects such as hazing or smudging as an inherent characteristic. These are visual effects only and do not affect the performance or life span of the Goods and is not considered a defect by the relevant Australian Standard; and</li>\r\n	<li>\r\n		all natural stone, terracotta and other porous tiles and Goods may be subject to salt attack and must be kept properly sealed at all times &ndash; including any bullnosed or exposed edges. As a rule-of-thumb, when water no longer &ldquo;beads&rdquo; on the surface of porous tiles and Goods, they then require re-sealing. Porous tiles and Goods must have an effective, working sealer barrier present at all times to be properly sealed and inhibit salt infiltration.</li>\r\n</ol>\r\n<p>\r\n	The Seller shall not be held liable for any loss, damages, or costs however resulting from any acids, chemical compounds, abrasives or solvents used in the cleaning or installation of any Goods. This is irrespective of whether or not the cleaning is conducted by the Seller, the Buyer, or a third party (provided that it was conducted as a result of the Buyer&rsquo;s direct request). Hydrochloric acid in particular, should never be used on the surface of any type of tile, natural stone or terracotta.</p>\r\n<p>\r\n	In the event the Buyer requires tradesman or contractors to complete the works or installation of the Goods supplied by the Seller, or other goods held by the Buyer, the Seller can supply other contractors&rsquo; names or details, however this does not imply that the Seller guarantees their workmanship or professional conduct, and shall not be held liable for any loss, damages or costs however resulting from the Buyer using the names or details supplied by the Seller.</p>\r\n<p>\r\n	The Seller, its employees, agents and subcontractors are not liable for any expense or injury arising from the use, misuse, storage or transport of any Goods supplied.</p>\r\n<ol start="7" type="1">\r\n	<li>\r\n		<h2>\r\n			<strong>Buyer&rsquo;s Responsibilities</strong></h2>\r\n	</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		The Buyer acknowledges and agrees that it is their responsibility to:</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		Upon delivery and before laying, installation or use, to check and inspect all Goods for correctness of type, quantity, quality, aesthetics / appearance and suitability of purpose before installation. In the case of tiles and items sold by the square metre, or designed to cover a surface, these Goods should be laid out to dry (without adhesive) in final situ with adequate lighting for inspection and approval of the Goods. In cases where the Buyer is a re-seller or trade contractor procuring the Goods and arranging their installation for a client, or on-selling the Goods, the final intended owner(s) of the Goods should always conduct and be present for this inspection of the Goods prior to approving laying, installation or use of the same. NOTE: The act of laying, installing and using the Goods constitutes the Buyer&rsquo;s full and unconditional acceptance and approval of all the characteristics of the Goods in all regards. No claims whatsoever will be accepted in regard to correctness of type, quantity, quality, aesthetics / appearance, and suitability of purpose after laying, installation or use; and</li>\r\n	<li>\r\n		ensure that the method by which the Buyer, or their subcontractor, proposes to install or apply the Goods are in accordance with accepted industry standards (e.g. AS3958.1-2007 or its successor Standards), are satisfactory for the purpose intended, and that all instructions issued by the manufacturer of the Goods, adhesive, grout and other incidental materials used are precisely followed (and safe-work practices) are followed during installation, including but not limited to: use of eye and hearing protection, observation of electrical safety; and</li>\r\n	<li>\r\n		ensure that a receipt note is obtained from the Seller on delivery. Goods shall not be accepted for return or as a defect if no receipt note can be shown by the Buyer; and</li>\r\n	<li>\r\n		ensure that sufficient Goods are purchased to complete the works. The Seller cannot guarantee the ongoing or future supply of any Goods. Quantity estimates of Goods required, and provided to the Buyer by the Seller, their employees or associates are purely estimates, and as such, the Seller will not accept any liability for any shortfall or oversupply of Goods; and</li>\r\n	<li>\r\n		maintain the Goods after laying, installation or use in ways including but not limited to: observing a proper cleaning regimen, keeping abrasive materials (e.g. sand) away from the Goods, protecting Goods from impact damage by foreign objects, and keeping natural stone tiles, marble tiles, slate, terracotta tiles, porcelain tiles or other porous Goods properly sealed at all times so that water &ldquo;beads&rdquo; on the surface at all times and does not penetrate any porous tile varieties.</li>\r\n</ol>', '<ol start="8" type="1">\r\n	<li>\r\n		<h2>\r\n			<strong>Title</strong></h2>\r\n	</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		The Seller and the Buyer agree that ownership of the Goods shall not pass until:</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		the Buyer has paid the Seller all amounts owing for the particular Goods; and</li>\r\n	<li>\r\n		the Buyer has met all other obligations due by the Buyer to the Seller in respect of all contracts between the Seller and the Buyer.</li>\r\n</ol>\r\n<p>\r\n	Receipt by the Seller of any form of payment other than cash shall not be deemed to be payment until that form of payment has been honoured, cleared or recognised and until then the Seller&rsquo;s ownership or rights in respect of the Goods shall continue.</p>\r\n<p>\r\n	It is further agreed that:</p>\r\n<ol start="1" type="1">\r\n	<li>\r\n		where practicable the Goods shall be kept separate and identifiable until the Seller shall have received payment and all other obligations of the Buyer are met; and</li>\r\n	<li>\r\n		until such time as ownership of the Goods shall pass from the Seller to the Buyer the Seller may give notice in writing to the Buyer to return the Goods or any of them to the Seller. Upon such notice the rights of the Buyer to obtain ownership or any other interest in the Goods shall cease; and</li>\r\n	<li>\r\n		the Seller shall have the right of stopping the Goods in transit whether or not delivery has been made; and</li>\r\n	<li>\r\n		if the Buyer fails to return the Goods to the Seller then the Seller or the Seller&rsquo;s agent may enter upon and into land and premises owned, occupied or used by the Buyer, or any premises as the invitee of the Buyer, where the Goods are situated and take possession of the Goods; and</li>\r\n	<li>\r\n		the Buyer is only a bailee of the Goods and until such time as the Seller has received payment in full for the Goods then the Buyer shall hold any proceeds from the sale or disposal of the Goods, up to and including the amount the Buyer owes to the Seller for the Goods, on trust for the Seller; and</li>\r\n	<li>\r\n		the Buyer shall not deal with the money of the Seller in any way which may be adverse to the Seller; and</li>\r\n	<li>\r\n		the Buyer shall not charge the Goods in any way nor grant nor otherwise give any interest in the Goods while they remain the property of the Seller; and</li>\r\n	<li>\r\n		the Seller can issue proceedings to recover the Price of the Goods sold notwithstanding that ownership of the Goods may not have passed to the Buyer; and</li>\r\n	<li>\r\n		until such time that ownership in the Goods passes to the Buyer, if the Goods are converted into other products, the parties agree that the Seller will be the owner of the end products.&nbsp;</li>\r\n</ol>\r\n<h2>\r\n	<a id="_Ref142792633" name="_Ref142792633"></a><a id="_Ref180296990" name="_Ref180296990"></a><strong>Defects</strong></h2>\r\n<ol start="1" type="1">\r\n	<li>\r\n		<a id="_Ref180297061" name="_Ref180297061"></a><a id="_Ref142792453" name="_Ref142792453"></a>The Buyer shall inspect the Goods on delivery (before laying, installation or use) by checking and inspecting all Goods for correctness of type, quantity, quality, aesthetics / appearance and suitability of purpose prior to installation. The act of laying, installing or use the Goods constitutes the Buyer&rsquo;s full and unconditional acceptance and approval of all the characteristics of the Goods in all regards.</li>\r\n	<li>\r\n		The Buyer shall within two (2) days of delivery (time being of the essence) notify the Seller of any alleged defect, shortage in quantity, damage or failure to comply with the description, quote or sample. The Buyer shall afford the Seller an opportunity to inspect the Goods within a reasonable time following delivery if the Buyer believes the Goods are defective in any way. If the Buyer shall fail to comply with these provisions the Goods shall be presumed to be free from any defect or damage. For defective Goods, which the Seller has agreed in writing that the Buyer is entitled to reject, the Seller&rsquo;s liability is limited to either (at the Seller&rsquo;s absolute discretion) re-delivering the Goods or equivalent Goods (no installation, re-installation, removal or labour charges of any kind are payable) or repairing the Goods except where the Buyer has acquired Goods as a consumer within the meaning of the Trade Practices Act 1974 (CWlth) or the Fair Trading Acts of the relevant state or territories of Australia, and is therefore also entitled to, at the consumer&rsquo;s discretion either a refund of the purchase price of the Goods, or repair of the Goods, or re-delivery of the Goods or equivalent Goods (no installation, re-installation, removal or labour charges of any kind are payable). No further damages in respect of any defect claim are applicable.</li>\r\n	<li>\r\n		ISO13006-1998 and AS4662-2003 (Ceramic tiles &ndash; definitions, classification, characteristics and marking) allow that ninety-five percent (95%) of tiles packed as first quality to actually be firsts. This requirement is less than one hundred percent (100%) to allow for a margin of human error. Defects which render tiles second quality may include but are not limited to: minor chips, glaze faults, shading variation, specks and spots (etc); and are all aesthetic rather than structural, and hence a second quality tile will have the same physical performance as first quality tiles without the same appearance characteristics. It should be noted that with some surface blemishes such as spots and specks, the actual size of the spot or speck which is acceptable as either a first or second quality will vary from tile type to tile type, depending on colour, pattern, surface treatment and intended application.</li>\r\n	<li>\r\n		EN1469 (Natural Stone Products for Cladding) allows for specific + / - variations in tolerances and dimensions between pieces for natural stone cut to specific sizes. Depending on size format, allowable size and thickness variation can be up to + / - 10% or as much as + / - 5mm.</li>\r\n</ol>\r\n<h2>\r\n	<strong>Returns</strong></h2>\r\n<ol start="1" type="1">\r\n	<li>\r\n		Returns will only be accepted provided that:</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		the Buyer has complied with the provisions of clause 9.1; and</li>\r\n	<li>\r\n		the Seller has agreed in writing to accept the return of the Goods; and</li>\r\n	<li>\r\n		the Goods are returned at the Buyer&rsquo;s cost within twenty-one (21) days of the delivery date; and</li>\r\n	<li>\r\n		the Seller will not be liable for Goods which have not been stored or used in a proper manner; and</li>\r\n	<li>\r\n		the Goods are returned with the invoice or receipt note that was issued upon delivery; and</li>\r\n	<li>\r\n		the Goods are returned in the condition in which they were delivered, remain in original unopened boxes and with all packaging material, brochures and instruction material in as new condition as is reasonably possible in the circumstances, and be from current, general stock presently held in store by the Seller.</li>\r\n</ol>\r\n<p>\r\n	The Seller may (at their sole discretion) accept the return of Goods for credit but this may incur a handling fee of up to twenty-five percent (25%) of the value of the returned Goods plus any freight costs.</p>\r\n<p>\r\n	Goods sold in pallet or container lots, or sold at wholesale or discount Prices, or sold as run of kiln or second quality, or Goods specifically sourced, bought-in, ordered or indented, are under no circumstances acceptable for credit or return.</p>\r\n<p>\r\n	Non-stocklist items, discontinued items, Goods which are no longer current batches / shades / calibres or Goods made to the Buyer&rsquo;s specifications are under no circumstances acceptable for credit or return.</p>\r\n<p>\r\n	A goods receipt must be obtained by the Buyer from the Seller as proof of return of Goods. No responsibility or liability is accepted for Goods returned or left without a receipt having been issued by the Seller.</p>\r\n<p>\r\n	The Seller reserves the right to refuse to accept any Goods for credit at its sole discretion.</p>\r\n<h2>\r\n	<a id="_Ref180297020" name="_Ref180297020"></a><strong>Warranty</strong></h2>\r\n<ol start="1" type="1">\r\n	<li>\r\n		<a id="_Ref156273185" name="_Ref156273185"></a>Subject to the conditions of warranty set out in clause 11.2, the Seller warrants that if any defect in the Goods as judged by the prevailing Australian Standard (if applicable) for those Goods, becomes apparent and is reported to the Seller within six (6) months of the date of delivery (time being of the essence) then the Seller will in its absolute discretion attempt to repair the Goods, or in the event that the Goods cannot be repaired, re-deliver the Goods with the same or equivalent Goods, or refund the purchase price of the Goods. No installation, re-installation, materials removal or labour charges, or further damages of any kind are payable or form part of this warranty.</li>\r\n	<li>\r\n		<a id="_Ref156729825" name="_Ref156729825"></a>The conditions applicable to the warranty given by clause 11.1 are:</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		the warranty shall not cover any defect or damage which may be caused or partly caused by or arise through:</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		failure on the part of the Buyer, or their subcontractor, to properly maintain any Goods (including but not limited to: observing a proper cleaning regimen or failing to keep natural stone tiles, marble tiles, slate, sandstone, granite, terracotta tiles, porcelain tiles or other porous goods properly sealed at all times so that water &ldquo;beads&rdquo; on the surface at all times and does not penetrate any porous tile varieties); or</li>\r\n	<li>\r\n		failure on the part of the Buyer, or their subcontractor, to precisely follow any instructions or guidelines provided by the Seller; or</li>\r\n	<li>\r\n		any use of any Goods otherwise than for any application specified on a quote or order form or manufacturer&rsquo;s recommendation; or</li>\r\n	<li>\r\n		the continued use of any Goods after any defect becomes apparent or would have become apparent to a reasonably prudent operator or user; or</li>\r\n	<li>\r\n		fair wear and tear, natural occurrence, any accident or act of God; or</li>\r\n	<li>\r\n		failure on the part of the Buyer, or their subcontractor, to report to the Seller prior to laying, installation or use any pre-existing issue relating to the Goods, including but not limited to those of an aesthetic or visual nature which were present prior to the laying, installation or use of the Goods, and subsequently forms the basis of a claim by the Buyer; or</li>\r\n	<li>\r\n		failure by the Buyer to adequately inform the Seller before delivery of any special site-situational requirements and special characteristics or physical properties required of the Goods for the Buyer&rsquo;s proposed application. This may include but is not limited to requirements for: high impact resistance, a particular slip-resistance requirement, suitability for immersion in water and suitability for heavy traffic areas; or</li>\r\n	<li>\r\n		failure by the Buyer, or their subcontractor, to install the Goods in accordance with the prevailing Australian Standard (e.g. AS3958.1-2007 or its successor Standard); or</li>\r\n	<li>\r\n		failure by the Buyer, or their subcontractor, to precisely follow installation, use, maintenance or other instructions as they may appear on the manufacturer&rsquo;s packaging, literature or internet website; or</li>\r\n	<li>\r\n		failure by the Buyer, or their subcontractor, to precisely follow all instructions issued by the manufacturer of the adhesive, grout and other incidental materials used as they may appear on their packaging, literature or internet website.</li>\r\n</ol>\r\n<p>\r\n	the warranty shall cease and the Seller shall thereafter in no circumstances be liable under the terms of the warranty if the workmanship is repaired, altered or overhauled without the Seller&rsquo;s consent.</p>\r\n<p>\r\n	in respect of all claims the Seller shall not be liable to compensate the Buyer for any delay in either re-delivering or remedying the workmanship or in properly assessing the Buyer&rsquo;s claim.</p>\r\n<p>\r\n	the warranty is limited to replacement value of the Goods only (no installation, re-installation, removal or labour charges or further damages of any kind are payable) and the Seller shall not be liable for any consequential loss or damage that may arise from the defective Goods.</p>\r\n<p>\r\n	For Goods under warranty from the original supplier to the Seller, the warranty shall be the current warranty provided by the supplier of the Goods. The Seller shall not be bound by nor be responsible for any term, condition, representation or warranty other than that which is given by the supplier or manufacturer of the Goods.</p>\r\n<p>\r\n	Goods made from natural products including but not limited to: terracotta, wood, stone, slate, marble, sandstone and granite are sold on the basis that they are man-manipulated (but not man-made) and are therefore sold with no guarantee or warranty whatsoever.</p>\r\n<p>\r\n	Any agents, resellers or distributors of the Seller are agents for sale only and are not authorised to extend or vary this warranty.</p>\r\n<p>\r\n	In the event of a claim, the Seller reserves the right to delegate representation on its behalf in relation to the matter to third parties including but not limited to the Seller&rsquo;s liability insurer.</p>\r\n<h2>\r\n	<strong>Intellectual Property</strong></h2>\r\n<ol start="1" type="1">\r\n	<li>\r\n		Where the Seller has designed, drawn or written Goods for the Buyer, then the copyright in those designs and drawings and documents shall remain vested in the Seller, and shall only be used by the Buyer at the Seller&rsquo;s discretion.</li>\r\n	<li>\r\n		The Buyer warrants that all designs or instructions to the Seller will not cause the Seller to infringe any patent, registered design or trademark in the execution of the Buyer&rsquo;s order and the Buyer agrees to indemnify the Seller against any action taken by a third party against the Seller in respect of any such infringement.</li>\r\n	<li>\r\n		The Buyer hereby authorises the Seller to utilise images of the Goods designed or drawn by the Seller in advertising, marketing, or competition material by the Seller.</li>\r\n</ol>\r\n<h2>\r\n	<strong>Default and Consequences of Default </strong></h2>\r\n<ol start="1" type="1">\r\n	<li>\r\n		Interest on overdue invoices shall accrue daily from the date when payment becomes due, until the date of payment, at a rate of two and a half percent (2.5%) per calendar month (and at the Seller&rsquo;s sole discretion such interest shall compound monthly at such a rate) after as well as before any judgment.</li>\r\n	<li>\r\n		In the event that the Buyer&rsquo;s payment is dishonoured for any reason the Buyer shall be liable for any dishonour fees incurred by the Seller.</li>\r\n	<li>\r\n		If the Buyer defaults in payment of any invoice when due, the Buyer shall indemnify the Seller from and against all costs and disbursements incurred by the Seller in pursuing the debt including legal costs on a solicitor and own client basis and the Seller&rsquo;s collection agency costs.</li>\r\n	<li>\r\n		Without prejudice to any other remedies the Seller may have, if at any time the Buyer is in breach of any obligation (including those relating to payment) the Seller may suspend or terminate the supply of Goods to the Buyer and any of its other obligations under the terms and conditions. The Seller will not be liable to the Buyer for any loss or damage the Buyer suffers because the Seller has exercised its rights under this clause.</li>\r\n	<li>\r\n		If any account remains overdue after thirty (30) days then an amount of the greater of twenty dollars ($20.00) or ten percent (10%) of the amount overdue (up to a maximum of two hundred dollars ($200.00)) shall be levied for administration fees which sum shall become immediately due and payable.</li>\r\n	<li>\r\n		Without prejudice to the Seller&rsquo;s other remedies at law the Seller shall be entitled to cancel all or any part of any order of the Buyer which remains unfulfilled and all amounts owing to the Seller shall, whether or not due for payment, become immediately payable in the event that:</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		any money payable to the Seller becomes overdue, or in the Seller&rsquo;s opinion the Buyer will be unable to meet its payments as they fall due; or</li>\r\n	<li>\r\n		the Buyer becomes insolvent, convenes a meeting with its creditors or proposes or enters into an arrangement with creditors, or makes an assignment for the benefit of its creditors; or</li>\r\n	<li>\r\n		a receiver, manager, liquidator (provisional or otherwise) or similar person is appointed in respect of the Buyer or any asset of the Buyer.</li>\r\n</ol>\r\n<h2>\r\n	<strong>Cancellation</strong></h2>\r\n<ol start="1" type="1">\r\n	<li>\r\n		The Seller may cancel any contract to which these terms and conditions apply or cancel delivery of Goods at any time before the Goods are delivered by giving written notice to the Buyer. On giving such notice the Seller shall repay to the Buyer any sums paid in respect of the Price. The Seller shall not be liable for any loss or damage whatsoever arising from such cancellation.</li>\r\n	<li>\r\n		In the event that the Buyer cancels delivery of Goods the Buyer shall be liable for any loss incurred by the Seller (including, but not limited to, any loss of profits or forfeiture of deposits paid) up to the time of cancellation.</li>\r\n	<li>\r\n		Cancellation of orders for Goods made to the Buyer&rsquo;s specifications or non-stocklist items will definitely not be accepted, once production has commenced.</li>\r\n</ol>\r\n<h2>\r\n	<strong>Unpaid Seller&rsquo;s Rights</strong></h2>\r\n<ol start="1" type="1">\r\n	<li>\r\n		Where the Buyer has left any item with the Seller for repair, modification, exchange or for the Seller to perform any other Service in relation to the item and the Seller has not received or been tendered the whole of the Price, or the payment has been dishonoured, the Seller shall have:</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		a lien on the item;</li>\r\n	<li>\r\n		the right to retain the item for the Price while the Seller is in possession of the item;</li>\r\n	<li>\r\n		a right to sell the item.</li>\r\n</ol>\r\n<p>\r\n	The lien of the Seller shall continue despite the commencement of proceedings, or judgment for the Price having been obtained.</p>\r\n<h2>\r\n	<strong>&nbsp;Equipment Hire</strong></h2>\r\n<ol start="1" type="1">\r\n	<li>\r\n		The Equipment shall at all times remain the property of the Seller and is returnable on demand by the Seller. In the event that the Equipment is not returned to the Seller in the condition in which it was delivered the Seller retains the right to charge the Price of repair or replacement of the Equipment.</li>\r\n	<li>\r\n		The Buyer shall:</li>\r\n</ol>\r\n<ol start="1" type="1">\r\n	<li>\r\n		keep the Equipment in their own possession and control and shall not assign the benefit of the Equipment nor be entitled to lien over the Equipment.</li>\r\n	<li>\r\n		not alter or make any additions to the Equipment including but without limitation altering, make any additions to, defacing or erasing any identifying mark, plate or number on or in the Equipment or in any other manner interfere with the Equipment.</li>\r\n	<li>\r\n		keep the Equipment, complete with all parts and accessories, clean and in good order as delivered, and shall comply with any maintenance schedule as advised by the Seller to the Buyer.</li>\r\n</ol>\r\n<p>\r\n	The Buyer accepts full responsibility for the safekeeping of the Equipment and the Buyer agrees to insure, or self insure, the Seller&rsquo;s interest in the Equipment and agrees to indemnify the Seller against physical loss or damage including, but not limited to, the perils of accident, fire, theft and burglary and all other usual risks and will effect adequate Public Liability Insurance covering any loss, damage or injury to property or persons arising out of the use of the Equipment. Further the Buyer will not use the Equipment nor permit it to be used in such a manner as would permit an insurer to decline any claim.</p>\r\n<h2>\r\n	<strong>Communication Between Seller &amp; Buyer</strong></h2>\r\n<ol start="1" type="1">\r\n	<li>\r\n		<a href="http://www.tilesbrisbane.com.au">www.tilesbrisbane.com.au</a> will use e-mail &amp; telephone to contact you about your purchase. Buyers must provide a valid e-mail address and, if possible, 2 phone numbers (preferably mobile) during the online order process.&nbsp; In the event that the Seller is unable to contact the Buyer due to inaccurate or unresponsive e-mail or phone details, <a href="http://www.tilesbrisbane.com.au/">TilesBrisbane.com.au</a> reserves the right to cancel any scheduled delivery and charge a reasonable rebooking, storage or re-delivery fee as applicable.</li>\r\n</ol>\r\n<h2>\r\n	<strong>General</strong></h2>\r\n<ol start="1" type="1">\r\n	<li>\r\n		If any provision of these terms and conditions shall be invalid, void, illegal or unenforceable the validity, existence, legality and enforceability of the remaining provisions shall not be affected, prejudiced or impaired.</li>\r\n	<li>\r\n		These terms and conditions and any contract to which they apply shall be governed by the laws of Queensland and are subject to the jurisdiction of the courts of Queensland.</li>\r\n	<li>\r\n		The Seller shall be under no liability whatsoever to the Buyer for any indirect and/or consequential loss and/or expense (including loss of profit) suffered by the Buyer arising out of a breach by the Seller of these terms and conditions.</li>\r\n	<li>\r\n		In the event of any breach of this contract by the Seller the remedies of the Buyer shall be limited to damages which under no circumstances shall exceed the Price of the Goods.</li>\r\n	<li>\r\n		The Buyer shall not be entitled to set off against, or deduct from the Price, any sums owed or claimed to be owed to the Buyer by the Seller nor to withhold payment of any invoice because part of that invoice is in dispute.</li>\r\n	<li>\r\n		The Seller may license or sub-contract all or any part of its rights and obligations without the Buyer&rsquo;s consent.</li>\r\n	<li>\r\n		The Buyer agrees that the Seller may review these terms and conditions at any time. If, following any such review, there is to be any change to these terms and conditions, then that change will take effect from the date on which the Seller publishes such change(s) at <a href="www.tilesbrisbane.com.au/conditions">www.tilesbrisbane.com.au/conditions</a>.</li>\r\n	<li>\r\n		Neither party shall be liable for any default due to any act of God, war, terrorism, strike, lock-out, industrial action, fire, flood, storm or other event beyond the reasonable control of either party. The failure by the Seller to enforce any provision of these terms and conditions shall not be treated as a waiver of that provision, nor shall it affect the Seller&rsquo;s right to subsequently enforce that provision. The Seller&rsquo;s internet website <u><a href="http://www.tilesbrisbane.com.au">www.tilesbrisbane.com.au</a></u> is for information purposes only and provided in good faith. Neither the Seller or its agents take responsibility for any errors or omissions.</li>\r\n	<li>\r\n		Clerical errors, typing errors or other errors on our website or in computation, quotation, invoice, delivery docket, credit note or on other documents issued by the Seller shall be excepted and subject to correction by the Seller. The Seller in its absolute discretion, may at any time, and from time to time, add to, delete, edit and modify any of these terms and conditions.</li>\r\n	<li>\r\n		In these Terms and Conditions of Trade, headings are for convenience only and do not affect their interpretation.</li>\r\n</ol>', '0px', '0px', '0px', 0, 0, 1, '30/10/2014 (05:50pm)'),
(6, 0, 99, '', '', '', 'PRIVACY POLICY', '', 'Privacy Policy', 'privacy-policy.php', '', 1, 0, '<p>\r\n	This privacy policy statement has been made in accordance with amendments to the Australian Federal Government Privacy Amendment (Private Sector) Act 2000 (New Privacy Laws) which took effect from 21 December 2001.</p>\r\n<h2>\r\n	<strong>Information collected<br />\r\n	</strong></h2>\r\n<p>\r\n	When you look at the website of: www.tilesbrisbane.com.au, we make a record of your visit and log the following information for statistical purposes:</p>\r\n<ul>\r\n	<li>\r\n		your server address</li>\r\n	<li>\r\n		your top level domain name (for example .com, .gov, .au, .uk etc)</li>\r\n	<li>\r\n		the pages you accessed and documents downloaded</li>\r\n	<li>\r\n		the previous site you have visited</li>\r\n	<li>\r\n		the type of browser you are using.</li>\r\n</ul>\r\n<h2>\r\n	<strong>Access to information collected<br />\r\n	</strong></h2>\r\n<p>\r\n	www.tilesbrisbane.com.au will not make an attempt to identify users or their browsing activities. However, in the unlikely event of an investigation, a law enforcement agency or other government agency may exercise its legal authority to inspect our Internet Service Provider&#39;s logs. To process orders and support your customer relationship with www.tilesbrisbane.com.au certain information will need to be provided by users via online forms, email or phone. We undertake to keep such information confidential and not share it with any unrelated third party.</p>\r\n<h2>\r\n	<strong>Use and disclosure of information collected<br />\r\n	</strong></h2>\r\n<p>\r\n	Our Office will only record your e-mail address if you send us a message. Your e-mail address will only be used or disclosed for the purpose for which you have provided it and it will not be added to a mailing list or used or disclosed for any other purpose without your consent.</p>\r\n<p>\r\n	Users are advised that there are inherent risks transmitting information across the Internet.</p>', '<h2>\r\n	<strong>Cookies<br />\r\n	</strong></h2>\r\n<p>\r\n	This Website uses temporary cookies. Cookies are non-harmful data files placed on the user&#39;s computer hard drive, and it allows www.tilesbrisbane.com.au to determine if the user is a return customer whenever the user visits the Web site again. These data files may also be used to review how a user uses a Web site or to personalize the Website for the user&#39;s browsing experience. Browsers usually accept cookies automatically, but users may change their browser settings so that cookies can only be accepted by clicking on an accept button.</p>\r\n<p>\r\n	Cookies can be either &quot;persistent&quot; or &quot;session&quot; based. Persistent cookies are stored on your computer, contain an expiration date, and may be used to track your browsing behaviour upon return to the issuing Web site. Session cookies are short-lived, are used only during a browsing session, and expire when you quit your browser.</p>\r\n<p>\r\n	Cookies from www.tilesbrisbane.com.au can be manually cleared or deleted from the user&#39;s computer hard drive via the options or preferences in their Internet Browser.</p>\r\n<h2>\r\n	<strong>Contact Us<br />\r\n	</strong></h2>\r\n<p>\r\n	www.tilesbrisbane.com.au<br />\r\n	Phone: 0419 774 758 (7 DAYS)<br />\r\n	Email: sales@tilesbrisbane.com.au<br />\r\n	P.O. Box 636<br />\r\n	ALDERLEY Q 4051</p>', '0px', '0px', '0px', 0, 0, 1, '01/12/2014 (01:30pm)');
