(7, 0, 99, '', '', '', 'DISCLAIMER', '', 'Disclaimer', 'disclaimer.php', '', 1, 0, '<p>\r\n	<strong>Use of this site</strong></p>\r\n<p>\r\n	www.tilesbrisbane.com.au (tilesbrisbane) is the owner and operator of this Website.</p>\r\n<p>\r\n	Users of this Site (Users) agree to be bound by these Terms &amp; Conditions, which are subject to change at tilesbrisbane&rsquo;s sole discretion. Your use of and access to this Site indicates your acceptance of these Terms &amp; Conditions, as they exist at that time.</p>\r\n<p>\r\n	Although tilesbrisbane has made every effort to produce information on this website that is current, informative and accurate, tilesbrisbane cannot guarantee or warrant this information is accurate or complete at any one particular time.<br />\r\n	Tilesbrisbane makes no representations or warranties of any kind, express or implied, as to the operation of the site or the information, content or details disclosed on this site.</p>\r\n<p>\r\n	<strong>Liability &amp; Indemnity</strong></p>\r\n<p>\r\n	Tilesbrisbane does not warrant the accuracy of the content on the Site. The content is provided to you &ldquo;as is&rdquo; and on an &ldquo;as available&rdquo; basis and on the condition that you undertake all responsibility for assessing the accuracy of the content and rely on it at your own risk. All content on the Site may be changed at tilesbrisbane&rsquo;s sole discretion and without notice.</p>\r\n<p>\r\n	Tilesbrisbane will have no responsibility or liability in relation to any loss or damage that you incur, including damage to your software or hardware, arising from your use of or access to this Site.</p>\r\n<p>\r\n	Tilesbrisbane does not warrant that functions contained in the Site content, such as hyperlinks, will be uninterrupted or error free, that defects will be corrected or that tilesbrisbane or the server that makes it available, are free of viruses or bugs.<br />\r\n	You indemnify tilesbrisbane and its affiliated companies, and the directors, officers, employees and agents against any action, claim, loss or expense which it incurs which arises from your use of the tilesbrisbane website.</p>\r\n<p>\r\n	<strong>Third Party Content &amp; Links<br />\r\n	</strong></p>\r\n<p>\r\n	This Site may include third party content, which is subject to that third party&#39;s terms and conditions of use. Nothing on this Site should be construed as granting any licence or right for you to use that content.</p>\r\n<p>\r\n	This Site may include links to third party sites which are not related to tilesbrisbane and in relation to which tilesbrisbane has no control or interest. The appearance of those links on this site does not indicate any relationship between tilesbrisbane and that third party or any endorsement by tilesbrisbane of that third party, its site or the products or services which it is advertising on this Site.</p>\r\n<p>\r\n	<strong>General<br />\r\n	</strong></p>\r\n<p>\r\n	All correspondence with tilesbrisbane via online forms, links or email client is conducted according to the tilesbrisbane &ldquo;Privacy Policy&rdquo;.</p>\r\n<p>\r\n	Products on the tilesbrisbane Website have been photographed to represent colour and pattern as close to the actual product as possible. However tilesbrisbane cannot guarantee how the images represent on a user&rsquo;s own computer and monitor and accepts no responsibility for accuracy of pattern, colour, shape, texture or size of products portrayed on the Site. It is the sole responsibility of the user to perform their own due diligence in respect to making a final purchase from tilesbrisbane.com.au.</p>', '', '0px', '0px', '0px', 0, 0, 1, '11/05/2013 (02:27pm)'),
(2, 0, 99, '', '', '', 'WELCOME TO TILESBRISBANE.COM.AU – YOUR ULTIMATE ONLINE TILE SOURCE!', '', 'About us', 'about-us.php', '', 0, 0, '<p>\r\n	We are direct importers/distributors of specialty wall tiles, floor tiles, natural stone tiles, tile installation materials &amp; accessories, and supply only first-quality tiles &amp; stone direct from our Brisbane warehouse at fantastic prices. <br />\r\n	We supply both residential &amp; commercial projects and offer free, expert advice to our customers 7 days a week. <br />\r\n	If you are looking for particular tiles that aren&#39;t listed, please ask us -- we may be able to help!</p>\r\n<h4>\r\n	On our site you can:</h4>\r\n<ul>\r\n	<li>\r\n		Explore our unrivalled product range with 24x7 convenience</li>\r\n	<li>\r\n		<a href="contact-us">Ask a question</a> &ndash; we have the answers you need!</li>\r\n	<li>\r\n		Save money through our online business model and get the latest-design tiles at the sharpest prices</li>\r\n	<li>\r\n		Buy only first quality tiles backed by factory &amp; statutory warranties</li>\r\n	<li>\r\n		Have us tailor the right delivery solution for you (even interstate or to remote areas) &ndash; we love a logistics &lsquo;challenge&rsquo;</li>\r\n	<li>\r\n		Need something extra special? Have us source custom tiles just for your project</li>\r\n</ul>\r\n<p>\r\n	All our listed products are displayed at our inner-city tilesbrisbane.com.au showroom and it is a fabulous resource for home-owners, trade &amp; specifiers alike. You are welcome to visit by appointment -- bookings are available through our <br />\r\n	<strong><a href="contact-us.php">Contact Us page</a></strong> or by calling <strong>0419 774 758</strong> (7 DAYS) or emailing: <strong><a href="mailto:sales@tilesbrisbane.com.au">sales@tilesbrisbane.com.au</a></strong>.</p>', '', '0px', '0px', '0px', 1, 0, 1, '30/10/2014 (07:41am)'),
(3, 0, 99, '', '', '', 'CONTACT US', '', 'Contact Us', 'contact-us.php', '', 1, 0, '<p>\r\n	<strong>www.tilesbrisbane.com.au</strong></p>\r\n<p>\r\n	<strong>Phone:</strong> 0419 774 758 (7 DAYS)<br />\r\n	<strong>Email:</strong> <a href="mailto:sales@tilesbrisbane.com.au">sales@tilesbrisbane.com.au</a></p>', '<p>\r\n	&nbsp;</p>', '0px', '0px', '0px', 1, 0, 1, '27/01/2015 (04:11pm)'),
(4, 0, 99, '', '', '', 'SHIPPING & RETURNS', '', 'Shipping & Returns', 'shipping-and-returns.php', '', 0, 0, '<h2>\r\n	DELIVERY</h2>\r\n<p>\r\n	At tilesbrisbane.com.au we are specialists in providing exactly the right transport solution to deliver your tile order safely &amp; securely &ndash; across Brisbane or across the country. We quote each delivery on a case-by-case basis to ensure the best transit time and value for money is achieved. Feel free to contact us to discuss the various delivery options available and your preferred delivery date. Enquiries for deliveries to remote or &lsquo;challenging&rsquo; locations are welcome!</p>\r\n<p>\r\n	Depending on the quantity of tiles ordered, our logistics team will schedule your delivery using Australia Post or our pool of couriers, hand-unload trucks, forklift trucks or crane trucks. Deliveries by these subcontractors generally arrive at their destination between 7am-6pm Monday to Friday. A customer contact phone number valid for the day of delivery is mandatory. Larger orders to some remote locations necessitate us logisting your tiles to a depot in the nearest available town rather than directly to your site.</p>\r\n<p>\r\n	Customers are also welcome to pickup orders ex our Brisbane warehouse using an appropriate vehicle or to arrange their own transport. We will provide the weight &amp; dimensions of your order upon request.<br />\r\n	&nbsp;</p>\r\n<h2>\r\n	RETURNS</h2>\r\n<p>\r\n	To assist you with your purchase, products shown on our website carry very detailed descriptions and offer the facility to ask us questions in advance of purchase. We ask that our customers choose from our range carefully, as goods refunds, exchanges &amp; credits are only possible if:</p>\r\n<ol>\r\n	<li>\r\n		The goods are deemed faulty when judged against the prevailing Australian Standard</li>\r\n	<li>\r\n		The goods have been incorrectly supplied by us (ie incorrect model/item)</li>\r\n	<li>\r\n		The goods differ from a sample previously provided (except where there is inherent shade patterning by design or nature within the tiles)</li>\r\n	<li>\r\n		The goods are unfit for a purpose for which we specified them as being suitable</li>\r\n</ol>\r\n<p>\r\n	Goods which have been over-ordered in quantity, were wrongly selected or which are no longer desired by the buyer (ie subject to &lsquo;change of mind&rsquo;) do not qualify for refund, exchange or credit.<br />\r\n	&nbsp;</p>\r\n<h2>\r\n	DAMAGED, FAULTY OR INCORRECT GOODS</h2>\r\n<p>\r\n	It is the responsibility of the customer to inspect all goods upon receipt and notify us within 2 working days with emailed photographs of any breakages, damages, shortages or irregularities within the goods. Replacements for these goods can only be provided once we have reviewed customer photographs and checked our own stock &amp; records followed our claims procedures.</p>\r\n<p>\r\n	<a href="contact-us.php"><strong>Contact us</strong></a> on <strong>0419 774 758</strong> (7 DAYS) or email to: <a href="mailto:sales@tilesbrisbane.com.au"><strong>sales@tilesbrisbane.com.au</strong></a> for further information.</p>', '', '0px', '0px', '0px', 1, 0, 1, '');
