(7, 'Contact form', 'floor tiles', 'WEBSITE ENQUIRY FORM\nTILESBRISBANE.COM\n******************************************************************\nNAME: Gary Bysouth\nE-MAIL ADDRESS: gsgbysouth@gmail.com\nPHONE: 0431993953\n******************************************************************\nENQUIRY/MESSAGE: \nAre you possibly around this weekend. To view some tiles please advise a time if possible.\n******************************************************************\nEnd of message.\n', 'Gary Bysouth', 'gsgbysouth@gmail.com', 'Admin', 'thetilemob@gmail.com', 0, '1407502573'),
(8, 'Contact form', 'where is your showroom please?', 'WEBSITE ENQUIRY FORM\nTILESBRISBANE.COM\n******************************************************************\nNAME: Kris\nE-MAIL ADDRESS: kristen.tulloch@gmail.com\n******************************************************************\nENQUIRY/MESSAGE: \nHi, \r\n\r\nI would like to come and look at some of your tiles please; in particular the NC223481 REGAL-BLUE and NC223378 ROYAL BLUE. Can you please advise where your showroom is, and whether I need to make an appointment for Wednesday afternoon?\r\n\r\nThanks,\r\n\r\nKris\n******************************************************************\nEnd of message.\n', 'Kris', 'kristen.tulloch@gmail.com', 'Admin', 'thetilemob@gmail.com', 0, '1408268005'),
(9, 'Contact form', 'Tiles please', 'WEBSITE ENQUIRY FORM\nTILESBRISBANE.COM\n******************************************************************\nNAME: lyn\nE-MAIL ADDRESS: lyndonald1000@yahoo.com.au\nPHONE: 0411257778\n******************************************************************\nENQUIRY/MESSAGE: \nWe need 24sq m of Galaxia Grigio tiles (340sq) to go between a hall & dining area. Can you pls help or suggest a plain white, matt or gloss, in that size so we can match the grout lines.\r\nCheers\r\nLyn\n******************************************************************\nEnd of message.\n', 'lyn', 'lyndonald1000@yahoo.com.au', 'Admin', 'thetilemob@gmail.com', 0, '1409038721'),
(10, 'Contact form', 'Help matching a tile', 'WEBSITE ENQUIRY FORM\nTILESBRISBANE.COM\n******************************************************************\nNAME: Baillie\nE-MAIL ADDRESS: Midnight_sky_3@hotmail.com\n******************************************************************\nENQUIRY/MESSAGE: \nJust wondering if you could match a tile from a photo. As I am wanting to tile more rooms in my house and do not have any left over tiles from when they were originally installed. They are white with pink swirls and some grey.\r\nThank you.\n******************************************************************\nEnd of message.\n', 'Baillie', 'Midnight_sky_3@hotmail.com', 'Admin', 'thetilemob@gmail.com', 0, '1409369498'),
