(13, 'Contact form', '450x450mm dark grey tiles x 45 sq mar', 'WEBSITE ENQUIRY FORM\nTILESBRISBANE.COM\n******************************************************************\nNAME: Tiffany Molloy\nE-MAIL ADDRESS: tiffanymolloy@gmail.com\nPHONE: 0413644053\n******************************************************************\nENQUIRY/MESSAGE: \nHi I was wondering if you have any dark grey tiles on special. Looking for 45sq maters of 450x450mm. Best cash price please, thanks Tiffany\n******************************************************************\nEnd of message.\n', 'Tiffany Molloy', 'tiffanymolloy@gmail.com', 'Admin', 'thetilemob@gmail.com', 0, '1410422946'),
