(246, 'NC221151', 'HONEYWOOD R11 TIMBERMAX', 'CISXILCAS80X13G', '80X13 CASTAGNO TIMBER R11 SLIP RESIST-CISA', '17.19', '165', '15.47', '148.5', '0', '0', '0', '0', '8.21', '78.8', 'a:1:{i:0;s:11:"TMF6016.jpg";}', '6', '21.03', 'M2', NULL, 'R11', 0, 0, 0, 0, 0, '9.6', '12', '1.25', '54', '67.5', '1FL', 'FLOOR TILE', '741', 'EVERSTONE PTY LTD', 'CI-X-CA-8013R', 'TMF6016', 'TILE', 'PORBOD', '250.130800', '010MM', 'EXTFLOOR', 'RECTIFIED', '160BEIGES', 'SLIPRESIST', 'TIMBER', 'TIMBERMAX', 'FLOOR', 'TIMBER', 'ITALY', 'CISA', 'P9-11U', '1100', NULL, 'YES', NULL, 'Easily the most authentic timber-look porcelain floor tiles available in the world, this material will have you doubting your own eyes!  Is it really a tile?  It must surely be timber ...\n\nProduced in Italy using the latest HIGH-DEFINITION digital-print technology, glaze is intricately applied to the tile surface to faithfully re-create all the detail, graining & nuances of natural timber -- delivering the maximum possible pattern variation to these first quality tiles. \n\nThese tiles have been tested as having an R11 slip-resistant surface, making them ideal for use not only internally, but also externally on decks, pathways & driveways.  Being porcelain, the greatest advantage these tiles have over natural timber is they won''t warp, crack or fade and NEVER need to be sanded or sealed/treated/coated, making them a true "set-and-forget" flooring option!\n\nTwo tile size options are available: 800x200mm and 800x130mm, which can be laid integrated (50/50 mixed) or as a single type.  Sells with a Tax Invoice and we''re happy to help with any technical or installation advice you may need.  The quality of these tiles is outstanding and potential buyers are definitely encouraged to inspect this material.', '1', 'GST Normal', 0, 0, NULL, '2015-03-10 00:34:04', 1),
